import React, { Component } from 'react';
class Properties extends Component {
  constructor(props) {
    super(props);
    this.fetchPropertyDetails = this.fetchPropertyDetails.bind(this);
  }

  fetchPropertyDetails = (e) => {
    const property = e.target.getAttribute('data-item');
    console.log('We need to get the details for ', property);
  }
  render() {
    return (
         <div>
             <table>
              <thead>
                <tr>
                  <th>Id</th>
                  <th>Name</th>
                  <th>Address</th>
                  <th>City</th>
                  <th>State</th>
                  <th>Zip Code</th>
                  <th>County</th>
                  <th>Phone</th>
                  <th>Type</th>
                  <th>Capacity</th>
                </tr>
              </thead>
              <tbody>
                  {this.props.properties.map((property, index) => (
                      <tr>
                          <td>{property.id}</td>
                          <td key={index} data-item={property} onClick={this.fetchPropertyDetails}>{property.name}</td>
                          <td>{property.address}</td>
                          <td>{property.city}</td>
                          <td>{property.state}</td>
                          <td>{property.zip_code}</td>
                          <td>{property.county}</td>
                          <td>{property.phone}</td>
                          <td>{property.type}</td>
                          <td>{property.capacity}</td>
                      </tr>
                    ))}
               </tbody>
             </table>
         </div>
    );
  }
}
export default Properties;
